import Header from "./components/Header";

function App(){

    return (
        <>
            <Header />

            <div className="container">

                <FeedbackList 
                    feedback = {feedback} 
                    handleDelete = {deleteFeedback}
                />

            </div>
        
        </>
    )
}

export default App;
